import {useState} from "react";
import {TextField} from "../../components/form/TextField";
import {ReactComponent as MailIcon} from "../../components/icons/mail.svg";
import {ReactComponent as PasswordIcon} from "../../components/icons/lock-closed.svg";
import * as PropTypes from "prop-types";

function RoundedButton({type, variant, children}) {
    const color = variant === 'primary' ? 'transition bg-purple-500 hover:bg-purple-600 active:bg-purple-700 text-white' : 'bg-purple-100 text-purple-500';
    return <button className={`p-3 rounded-full font-bold ${color}`} type={type}>
        {children}
    </button>
}

RoundedButton.propTypes = {
    variant: PropTypes.string,
    type: PropTypes.string,
    children: PropTypes.node
};

/**
 * Login form react component
 * @returns {null}
 * @constructor
 */
export function LoginForm() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    function handleSubmit(e){
        e.preventDefault();
    }

    return <div>
        <form className="flex flex-col gap-2" onSubmit={handleSubmit}>
            <TextField value={email} startIcon={<MailIcon />} onChange={setEmail} type="text" />
            <TextField value={password} startIcon={<PasswordIcon />} onChange={setPassword} type="password" />

            <RoundedButton variant="primary" type="submit">Login</RoundedButton>
        </form>
    </div>
}
